import React from 'react';
import { Link, useHistory } from 'react-router-dom';
import {Nav, Navbar} from 'react-bootstrap'
import styled from 'styled-components';

import background from '../assets/toyota-4x4-sunset.jpg'
import logo from '../assets/PneuS-06.png'

const Styles = styled.div`
background: -webkit-linear-gradient( rgba(0, 0, 0, 0.4) 100%,transparent 100%), url(${background});
height:100vh;
background-size:cover;
background-position:center;
`;

function Header() {  

    return(
       <React.Fragment>
           <Styles>
                <Navbar expand="lg" bg="none" variant="dark">
                    <Navbar.Brand href="#home">
                    <img
                        src={logo}
                        width="120"
                        height="50"
                        className="d-inline-block align-top"
                        alt="React Bootstrap logo"
                    />
                    </Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                            <Nav.Link><Link>Home</Link></Nav.Link>
                            <Nav.Link><Link>Promo</Link></Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>
                <div className=''></div>
           </Styles>
       </React.Fragment> 
    )}

export default Header;
